import React from "react";
import "./styles/logs.css";

const Logs = ({ logs, setLogs }) => {
  return (
    <div className="log-box">
      <h3>Logs:</h3>
      <div className="log-text">
        {logs.length > 0 ? <ul></ul> : <p>No hay logs aun</p>}
      </div>
    </div>
  );
};

export default Logs;
